import "./Work.css";
import React from "react";
import pro1 from "../assets/pro1.avif";
import {NavLink}from "react-router-dom";
const WorkCard=(Props)=>{
    return <div class="workcontainer">
        <h1 class="projectheading">Projects</h1>
        <div class="project-container">
            <div class="project-card">
                <img src={Props.imgsrc} alt="image"/>
                <h2 class="project-tittle">{Props.title}</h2>
                <div class="pro-detail">
                    <p>{Props.text} </p>
                    <div class="pro-btns">
                        <NavLink to="url.com" class="btn">{Props.view}</NavLink>
                        <NavLink to="url.com" class="btn">Source</NavLink>
                    </div>
                </div>
            </div>
        </div>
    </div>
}
export default WorkCard;
